import React, { Component } from 'react';
import './header.css';


 class Header extends Component {

    
    handleSearchSubmit(event) {

        //prevent the form to be submitted to its action url
        event.preventDefault();
        console.log("search button was clicked");
    }

    render() {

        return (

            //this is JSX code which is very similar to HTML we already know
            <div className="header">
                <header className="MainHeader"><h1 align="center"><b><span className="NameBlack">My Stuff:</span><span className="NameWhite">Classified Ads Web App</span> </b></h1></header>
                <div className="header-right">
                    <div className="search-container">
                        <form action="">
                            <input type="text" placeholder="Looking for..." name="ItemSearch" onChange={this.handleSearch} />
                            <b><font color ="white"> In </font></b>
                            <input type="text" placeholder="post code" name="LocationSearch" onChange={this.handleSearch} />
                            <button type="submit" onClick={this.handleSearchSubmit}>Search</button>
                        </form>
                        <button className="loginButton" type="Login" onClick={this.handleLogin}> Login </button>
            
                    </div>
                </div>
            </div>
        );
    }
}
export default Header;
